// Import image
import sensor_icon from "../icons/sensor.png";
import camera_trap_icon from "../icons/camera_trap.png";

const SENSORS = [
    {"type": "ground_water_level", "latitude":51.5094, "longitude":-2.5890, "id": 1, "icon": sensor_icon},
    {"type": "live_camera","latitude":51.5100,"longitude":-2.5957, "id": 2, "icon": sensor_icon},
    {"type": "camera_trap","latitude":51.5110,"longitude":-2.5917, "id": 1, "icon": camera_trap_icon},
    {"type": "noise_sensor","latitude":51.5110,"longitude":-2.5917, "id": 1, "icon": camera_trap_icon},
    {"type": "unique_public_source","latitude":51.5110,"longitude":-2.5917, "id": 1, "icon": camera_trap_icon}
];

export default SENSORS;
